INSERT INTO `articles` (`id`, `article_id`, `article_title`, `article_desc`, `image`, `article_category_id`, `author_id`, `created_at`, `updated_at`, `views`) VALUES
(6, 'articles-NBgMlunD7Kj3sowv', 'Pace of the 21st Century', 'PACE OF THE 21ST CENTURY \r\n\r\nMost of the world is in a hurry, always in a haste, yet very few people know where they are going in life. \r\n\r\nYes I know of the bullet trains, the race cars, am aware of concord,  I know of the fast internet. Though we have  all these technologies handy, we still don\'t know where we are heading to. But always in hurry.\r\n\r\n\r\nIt seems like the fast technologies are teaching us impatient. The place of diligence is becoming old fashion. Process not adhered to and training done half way. As a result we become half baked.  \r\n\r\nGetting to the wrong destination early is not an achievement. So, there is no use running while you are on the wrong road. \r\n\r\nHurry is the pace of the 21sth century, we hurry in our activities yet we end up being in unwanted destination. We don\'t know where to go but we are still in a hurry. \r\n\r\nLife is too precious to rush through it. Every stage is meant to be enjoyed and the lessons to be well learnt. Your pace shouldn\'t be determined by the technology, your pace should determine the  technology. \r\n\r\n\r\nObserve process, be Comitted to training and move at your own pace. Diligence is the secret of  great men, not speed. Be diligent.', '1628045436.jpg', 4, 20, '2021-08-04 01:50:36', '2021-09-22 04:36:16', '182'),
(7, 'articles-jWABCRZ7bpVaLxEv', 'SMASH YOUR GOALS', '*Smash Your goals* \r\n\r\nWe are living in a digitalised world where it\'s hard to emerge as an expert in your field yet simple because you have almost everything you will need at your finger tip. However, it takes consistency,  commitment and hard work to master any digital skill. A lot of entrepreneurs that succeeds on social media today have sowed their attentions and have taken calculated risk to break forth.\r\n\r\nSmashing your goals is not a mere saying, but sincere dedication to what\'s is essential. It\'s not enough to acquire a skill, sacrificing your time and denying yourself of something to prepare for the thing ahead.\r\n\r\nAny entrepreneur you see on this social app today that are impacting lives positively  paid the price a long time ago.\r\n\r\nThese people started with a step; they focus on their destination. But do you know?\r\nYou, too can achieve all these? Of course, you can.\r\n\r\nThe decision is yours; the risk you are afraid to take today might save you from tomorrow stress and heartache.\r\n\r\nWhatsoever your hands find, Do it now and don\'t procrastinate over it.\r\n\r\nYou have to take a step ahead of others; You are getting there.\r\n\r\n\r\nTMGR article TEAM.', '1630358001.jpg', 4, 22, '2021-08-30 20:13:22', '2021-09-22 04:17:26', '122'),
(8, 'articles-Im2iUrCxHXBvbQS6', 'THE AFRICAN LEADERSHIP PARADOX', '\"Everything rise and falls on leadership\" .... John C.Maxwell\r\nThis profound statement encapsulated in it are alot of things to consider.  Leadership in Africa has being reduced to Titles, positions, and losing it true essence.\r\n\r\nLeadership as I love to define: \"is the force that makes things happen, moving from point A to B\". Africa has over time experienced the rise and fall of different categories of leaders, but yet we don\'t seem to be moving forward. In Africa one leader can have so much power to make alot of differences but still yet, use it only to his/her personal interest\r\n\r\nThe primary focus of leadership is the people. And in Africa\'s leadership, this is not made the priority.  The   leaders focus on self aggrandizement (greed).  Visionless leaders trying to lead, and one will wonder where exactly are they taking Africa to. Because even the leaders can\'t point where they are heading to. \r\n\r\nThough this is not the end for Africa, there is hope. Africa is at a cross in her destiny. The question now is where are the leaders who will steward the season and chart the way forward? so we don\'t have to explain to our children why we also failed.\r\n\r\nBut there is a fresh wind blowing,  a fresh wind is blowing on the Continent  and breeding new sets of leaders. Men and women with crystal  vision of the Africa we want. individuals who have grasped the true essence of leadership, which is selflessness and servanthood. \r\nAfrica has waited long enough. now is the future we long awaited to create, join the train as we create the  Africa of Our Dreams.\r\n\r\nAfrica is possible\r\nBecause\r\nI am Africa\r\n\r\nJoshua Johaida James (Mr. Africa) \r\nLeadership Coach, pan Africanist \r\n\r\nTMGR ARTICLE  TEAM\r\n\r\ntmgrplatform.com', '1630861597.jpg', 5, 23, '2021-09-05 16:06:37', '2021-09-08 15:21:54', '3');
